_______________________________
Everywhere I wanted to go for lunch on our last day in Van had a lineup that we didn't have time to wait for, so we randomly chose this place instead.

I'm SO glad we did, because the food & service was absolutely incredible!

You can choose the shape & thickness you want for any of their noodle dishes & watch them hand-pull them in the kitchen.

The soup broth had a deliciously addictive, subtle sourness & wasn't overbearingly oily like other places I've been. They use a lot of radish, so it makes the broth nice & clean how I like it.

I also really liked the kick of cumin in the fried noodle dish, & how chewy the noodles were.

It's a family run business & our server (one of the Owners) was literally the sweetest human ever! She was so on top of everything & you can tell just how much pride she has for their restaurant & how happy it makes her to see people enjoying their passed-down family recipes.

